column8:
電子ライターは、カチッと音を鳴らして火花をスパークさせて着火する方式のガスライターです。メンテナンスはガスを補充するだけ!<table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">電子ライターは、カチッと音を鳴らして火花をスパークさせて着火する方式のガスライターです。メンテナンスはガスを補充するだけ!</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">H60.5×W30.5×D12.5mm</font><br><font color="#333333" size="-1">個装サイズ：13×8×3cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">約59g</font><br><font color="#333333" size="-1">個装重量：180g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">ケース:レバー:亜鉛ダイキャスト<br>プレート:アクリル・真鍮<br>燃料タンク:プラスチック</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">ガス容量:0.6g<br>着火回数:約200回<br>種別:電子ライター<br>燃料:ガス</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">付属品</font></td><td align="left"><font color="#333333" size="-1">取扱説明書<br>保証書(保証期間:2年)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">中国</font></td></tr></table><br><font color="#333333" size="-1">販売会社/広告文責<br>株式会社Hanbit<br>Tel 050-1040-7307</font><style type="text/css">
